  CashDrawerDir() {
    console.log('555555555555555555', 'working');
    const self = this;
   // USB Connection List
    ThermalPrinter.listPrinters(
      { type: 'usb' },
      function (printers) {
        if (printers.length > 0) {
          const deviceIdAsString = printers[0]?.deviceId;
          const vendorIdIdAsString = printers[0]?.vendorId;
          const productNameAsString = printers[0]?.productName;
          const manufacturerNameAsString = printers[0]?.manufacturerName;

          // Convert to numbers with default value of 0 if undefined
          const productNameAsNumber = parseInt(
            String(productNameAsString ?? '0'),
            10
          );
          const manufacturerNameAsNumber = parseInt(
            String(manufacturerNameAsString ?? '0'),
            10
          );
          const deviceIdAsNumber = parseInt(
            String(deviceIdAsString ?? '0'),
            10
          );
          const vendorIdAsNumber = parseInt(
            String(vendorIdIdAsString ?? '0'),
            10
          );

          // Now you have deviceIdAsNumber and vendorIdAsNumber as numbers.
          console.log('Device ID as number:', deviceIdAsNumber);
          console.log('Vendor ID as number:', vendorIdAsNumber);


          var printer = {
            productName: productNameAsNumber,
            manufacturerName: manufacturerNameAsNumber,
            id: deviceIdAsNumber,
            vendorId: vendorIdAsNumber,
          };

          // Image Encoder

          const sr = self.getRecpt2();
          // socket receive bytecode, therefore we need to create a byte stream by using esc-pos-encoder-ionic
          const encoder = new EscPosEncoder();
          // const result = encoder.initialize()

          let img = new Image();
          img.src = sr;
          // img.src = 'assets/sp.png';
          img.crossOrigin = '*';
          //WIDTH FOR 58mm page is 384 and for 80mm is 576
          let width = 320;
          img.width = width;
          img.onload = function () {
            let height = Math.floor(img.height / 8) * 8;
            console.log('width, height', width, height);
          
            let result = encoder
                  .align('center')
                  .image(img, width, height, 'atkinson',255)
                  .newline()
                  .newline()
                  .newline()
                  .line('Burra Kranthi Kiran')
                  .newline()
                  .newline()
                  .newline()
                  .newline()
                  .cut()
                  .newline()
                  .align("center")
                  .line("Cash Out Detail")
                  .table(
                      [
                        { width: 37, align: "left" },
                        { width: 11, align: "right" },
                      ],
                    [[`Qty`, `Item Name`, `Price`]]
                    )
                  .bold(true)
                  .align("left")
                  .line(`ENT`)
                  .bold(false)
                  .newline()
                  .encode();
            let printer_resultsString = Array.from(result, (byte: number) => ('0' + (byte & 0xFF).toString(16)).slice(-2)).join('');
            // cash code encoder
            var cashDrawerCommand = [16, 20, 0, 0, 0]; 
            const resultByte = encoder.raw(cashDrawerCommand).encode();
            let printer_command = Array.from(resultByte, (byte: number) => ('0' + (byte & 0xFF).toString(16)).slice(-2)).join('');
            var cashDrawerCommandDrct = "\x1B\x70\x00\x19\xFA";
          
            ThermalPrinter.printFormattedText(
              {
                type: 'usb',
                id: printer.id,
                text: cashDrawerCommandDrct
              },
              function () {
                console.log('Successfully printed!');
                console.log('Cash drawer opened successfully!');
              },
              function (error) {
                console.error('Printing error', JSON.stringify(error));
              }
            );
          };
        } else {
          console.error('No printers found!');
        }
      },
      function (error) {
        console.error("Ups, we can't list the printers!", error);
      }
    );
  }

